import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import ResearcherHomeScreen from "./pages/researcherHome";
import "./App.css";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/" component={ResearcherHomeScreen} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
